import React, {Component} from 'react';
import {Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton} from 'react-mdl';

class Projects extends Component {
	constructor(props) {
		super(props);
		this.state = {activeTab: 0};
	}
	togglecategories() {
			if(this.state.activeTab===0){
				return(
					<div className='projects-grid'>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
						  <CardTitle style={{color:'grey', height:'176px', width:'100%', background: 'url(https://github.com/wsun26/ece448/blob/master/MP4/pong.gif?raw=true) no-repeat center / contain'}}>AI Pong</CardTitle>
							<CardText>A Pong AI that learns from previous wins and losses to determine the best paddle position to continue playing. </CardText>
							<CardActions border>
								<Button colored href='https://github.com/wsun26/ece448/tree/master/MP4' target='_blank'>Github</Button>
							</CardActions>
						</Card>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
							<CardTitle style={{color:'grey', height:'176px', width:'100%', background: 'url(https://github.com/wsun26/ece448/blob/master/MP3/odds_94.png?raw=true) no-repeat center / contain'}}>Number Classifier</CardTitle>
							<CardText>A number classifier utilizing the MNIST dataset of handwritten numbers to create a Naïve Bayes classification for graphical numbers. </CardText>
							<CardActions border>
								<Button colored href='https://github.com/wsun26/ece448/tree/master/MP3' target='_blank'>Github</Button>
							</CardActions>
						</Card>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
							<CardTitle style={{color:'grey', height:'176px', width:'100%', background: 'url(http://slazebni.cs.illinois.edu/fall17/assignment2/board.png) no-repeat center / contain'}}>Number Classifier</CardTitle>
							<CardText>A number classifier utilizing the MNIST dataset of handwritten numbers to create a Naïve Bayes classification for graphical numbers. </CardText>
							<CardActions border>
								<Button colored href='https://github.com/wsun26/ece448/tree/master/MP3' target='_blank'>Github</Button>
							</CardActions>
						</Card>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
							<CardTitle style={{color:'grey', height:'176px', width:'100%', background: 'url(https://github.com/wsun26/ece448/blob/master/MP3/odds_94.png?raw=true) no-repeat center / contain'}}>Number Classifier</CardTitle>
							<CardText>A number classifier utilizing the MNIST dataset of handwritten numbers to create a Naïve Bayes classification for graphical numbers. </CardText>
							<CardActions border>
								<Button colored href='https://github.com/wsun26/ece448/tree/master/MP3' target='_blank'>Github</Button>
							</CardActions>
						</Card>
					</div>
				)
			} else if(this.state.activeTab === 1){
				return (
					<div><h1>This is Angular</h1></div>
				)
			} else if(this.state.activeTab === 2){
				return (
					<div><h1>This is VueJS</h1></div>
				)
			} else if(this.state.activeTab === 3){
				return (
					<div><h1>This is VueJS</h1></div>
				)
			}
	}

	render() {
		return(
			<div className='category-tabs'>
				<Tabs activeTab={this.state.activeTab} onChange={(tabId)=>this.setState({activeTab:tabId})} ripple>
					<Tab>Python</Tab>
					<Tab>JavaScript</Tab>
					<Tab>Senior Design</Tab>
					<Tab>Test</Tab>

				</Tabs>

				<Grid>
				  <Cell col={12}>
					  <div className='content'>{this.togglecategories()}</div>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default Projects;
